import React from 'react'

function NavigationBar() {

  const arr = [
    {
      id: 1,
      name: 'HOME'
    },
    {
      id: 2,
      name: 'ABOUT US'
    },
    {
      id: 3,
      name: 'CONTACT US'
    },
    {
      id: 4,
      name: 'PRICING'
    }
  ]

  return (
    <div>
      <button>{arr.name[0]}</button>
      <button>{arr.name[1]}</button>
      <button>{arr.name[2]}</button>
      <button>{arr.name[3]}</button>
    </div>
  )
}

export default NavigationBar
